要解这个简单的加法问题 \(20 + 49\)，我们直接相加即可。

\[
\begin{align*}
&\phantom{+}20\\
+ &\underline{49}\\
&\boxed{69}
\end{align*}
\]

要计算 \(14 + 80\) 的值，我们可以直接相加这两个数：

\[
\begin{align*}
&\phantom{+} 14\\
+ &\phantom{+}80\\
\hline
&\boxed{94}
\end{align*}
\]

